import React, { useEffect, useState } from "react";
import "./formpost.css";
const Formpost = () => {
  return (
    <div>
      <Form>
        <Form.Row>
            <Col>
            <Form.Control placeholder="First name" />
            </Col>
            <Col>
            <Form.Control placeholder="Last name" />
            </Col>
        </Form.Row>
    </Form>
    </div>
  );
};

export default Formpost;
